window.bookSummaryJSON = "<p>Nova Ren Suma's novels <i>17</i> and <i>Gone and Imaginary Girls</i> were named YALSA 2014 Outstanding Books for the College Bound. </p> <p><i>The Walls Around Us</i> introduces Violet, a dancer on the cusp of stardom, and Amber, who's been jailed in a juvenile detention home for years. Tying them together is the home's long-dead Orianna, who holds the key to dark mysteries. </p>"; 
